		"xml__comp_content": "<span class='subsection1 X_SUBJECTIVE' value='X_SUBJECTIVE'>\r\n  <span class='subheading1 X_SUBJECTIVE'>SUBJECTIVE</span> \r\n<span class='subsection2 X_Social_situation' value='X_Social_situation'>\r\n  <span class='subheading2 X_Social_situation'>Social situation</span> \r\n<span class='subsection3 X__yrkesliv' value='X__yrkesliv'>\r\n  <span class='subheading3 X__yrkesliv'>-yrkesliv</span> <span class='val'>Arbetar som kurator med LSS utredningar mm</span></span><!-- closing level 3 section X__yrkesliv-->\r\n<span class='subsection3 X__familjesituation' value='X__familjesituation'>\r\n  <span class='subheading3 X__familjesituation'>-familjesituation</span> <span class='val'>Nyinflyttad gift 3 barn varav ett bor hemma</span></span><!-- closing level 3 section X__familjesituation-->\r\n</span><!-- closing level 2 section X_Social_situation-->\r\n<span class='subsection2 X_Tid_halsoproblem' value='X_Tid_halsoproblem'>\r\n  <span class='subheading2 X_Tid_halsoproblem'>Tid hälsoproblem</span> <span class='val'>Graviditetstoxicos 1988 Pleurit 2001</span></span><!-- closing level 2 section X_Tid_halsoproblem-->\r\n<span class='subsection2 X_Aktuella_halsoproblem' value='X_Aktuella_halsoproblem'>\r\n  <span class='subheading2 X_Aktuella_halsoproblem'>Aktuella hälsoproblem</span> <span class='val'>Under peioder senaste 8 mån haft besvär med viss ömhet i buken ovan symfysen,mot vänster fossa.Tycker att det känns svullet.Nu  känningar i  dagar. Avföringsvnor oförändrade,vanligen viss obstipation. Inget blod eller slem..Litet tätare miktioner. Menopaus sedan 3 år. Ingen östrogensubstitution. Inga  bortfallssymtom,förutom periodvis nattsvettningr</span></span><!-- closing level 2 section X_Aktuella_halsoproblem-->\r\n</span><!-- closing level 1 section X_SUBJECTIVE-->\r\n<span class='subsection1 X_OBJECTIVE' value='X_OBJECTIVE'>\r\n  <span class='subheading1 X_OBJECTIVE'>OBJECTIVE</span> \r\n<span class='subsection2 X_Allmantillstand' value='X_Allmantillstand'>\r\n  <span class='subheading2 X_Allmantillstand'>Allmäntillstånd</span> <span class='val'>Normalbyggd Afebril</span><span class='subsection3 X__langd' value='X__langd'>\r\n  <span class='subheading3 X__langd'>-längd</span> <span class='val'>164</span></span><!-- closing level 3 section X__langd-->\r\n<span class='subsection3 X__vikt' value='X__vikt'>\r\n  <span class='subheading3 X__vikt'>-vikt</span> <span class='val'>61</span></span><!-- closing level 3 section X__vikt-->\r\n</span><!-- closing level 2 section X_Allmantillstand-->\r\n<span class='subsection2 X_Buk' value='X_Buk'>\r\n  <span class='subheading2 X_Buk'>Buk</span> <span class='val'>Mjuk. Lätt ömhet  bimanuellt palpationupp mot vänster fossa. Ingen scybala i ampullen eller palpabel i sigmoudeum</span></span><!-- closing level 2 section X_Buk-->\r\n<span class='subsection2 X_PR' value='X_PR'>\r\n  <span class='subheading2 X_PR'>PR</span> <span class='val'>Normalfynd</span></span><!-- closing level 2 section X_PR-->\r\n<span class='subsection2 X_Blodtryck__liggande' value='X_Blodtryck__liggande'>\r\n  <span class='subheading2 X_Blodtryck__liggande'>Blodtryck, liggande</span> \r\n<span class='subsection3 X__syst' value='X__syst'>\r\n  <span class='subheading3 X__syst'>-syst</span> <span class='val'>130</span></span><!-- closing level 3 section X__syst-->\r\n<span class='subsection3 X__diast' value='X__diast'>\r\n  <span class='subheading3 X__diast'>-diast</span> <span class='val'>75</span></span><!-- closing level 3 section X__diast-->\r\n<span class='subsection3 X__utgaende_remiss_ovrig' value='X__utgaende_remiss_ovrig'>\r\n  <span class='subheading3 X__utgaende_remiss_ovrig'>-utgående remiss övrig</span> <span class='val'>Gyn remiss 57 årig kvinna, Ingen fast medicinering. 3 gravida 3 para. Menopaus sedan ca 3 år. Aldrig fått östrogen. Sedan drygt 8 mån haft återkommande besvär från vänster fossa. Oförändrade avföringsvanor. Inga blödningar. Lätt omhet  uppåt vänster adnexa Tacksam fö gynekologisk underökning</span></span><!-- closing level 3 section X__utgaende_remiss_ovrig-->\r\n</span><!-- closing level 2 section X_Blodtryck__liggande-->\r\n</span><!-- closing level 1 section X_OBJECTIVE-->\r\n<span class='subsection1 X_LAB' value='X_LAB'>\r\n  <span class='subheading1 X_LAB'>LAB</span> \r\n<span class='subsection2 X_Urin' value='X_Urin'>\r\n  <span class='subheading2 X_Urin'>Urin</span> \r\n<span class='subsection3 X__U_glukos' value='X__U_glukos'>\r\n  <span class='subheading3 X__U_glukos'>-U-glukos</span> <span class='val'>0</span></span><!-- closing level 3 section X__U_glukos-->\r\n<span class='subsection3 X__U_protein' value='X__U_protein'>\r\n  <span class='subheading3 X__U_protein'>-U-protein</span> <span class='val'>0</span></span><!-- closing level 3 section X__U_protein-->\r\n<span class='subsection3 X__U_erytrocyter' value='X__U_erytrocyter'>\r\n  <span class='subheading3 X__U_erytrocyter'>-U-erytrocyter</span> <span class='val'>0</span></span><!-- closing level 3 section X__U_erytrocyter-->\r\n</span><!-- closing level 2 section X_Urin-->\r\n<span class='subsection2 X_Blod' value='X_Blod'>\r\n  <span class='subheading2 X_Blod'>Blod</span> \r\n<span class='subsection3 X__Hb' value='X__Hb'>\r\n  <span class='subheading3 X__Hb'>-Hb</span> <span class='val'>127</span></span><!-- closing level 3 section X__Hb-->\r\n</span><!-- closing level 2 section X_Blod-->\r\n</span><!-- closing level 1 section X_LAB-->\r\n<span class='subsection1 X_ASSESSMENT' value='X_ASSESSMENT'>\r\n  <span class='subheading1 X_ASSESSMENT'>ASSESSMENT</span> \r\n<span class='subsection2 X_Bedomt_tillstand' value='X_Bedomt_tillstand'>\r\n  <span class='subheading2 X_Bedomt_tillstand'>Bedömt tillstånd</span> <span class='val'>Idag ej tecken till divertikulit eller urinvägsinfektion. I första hand gynekologisk frågeställning Lämnar F-Hb x3 med telsvar</span></span><!-- closing level 2 section X_Bedomt_tillstand-->\r\n</span><!-- closing level 1 section X_ASSESSMENT-->\r\n<span class='subsection1 X_PLAN' value='X_PLAN'>\r\n  <span class='subheading1 X_PLAN'>PLAN</span> \r\n<span class='subsection2 X_Bedomt_aktivitetsbehov' value='X_Bedomt_aktivitetsbehov'>\r\n  <span class='subheading2 X_Bedomt_aktivitetsbehov'>Bedömt aktivitetsbehov</span> <span class='val'>Remiss gyn kliniken</span></span><!-- closing level 2 section X_Bedomt_aktivitetsbehov-->\r\n</span><!-- closing level 1 section X_PLAN-->\r\n<span class='subsection1 X_END' value='X_END'>\r\n  <span class='subheading1 X_END'>END</span> \r\n"
