		"xml__comp_content": "<span class='subsection1 X_SUBJECTIVE' value='X_SUBJECTIVE'>\r\n  <span class='subheading1 X_SUBJECTIVE'>SUBJECTIVE</span> \r\n<span class='subsection2 X_Levnadsvanor' value='X_Levnadsvanor'>\r\n  <span class='subheading2 X_Levnadsvanor'>Levnadsvanor</span> \r\n<span class='subsection3 X__rokning' value='X__rokning'>\r\n  <span class='subheading3 X__rokning'>-rökning</span> <span class='val'>icke rökare</span></span><!-- closing level 3 section X__rokning-->\r\n<span class='subsection3 X__fysisk_aktivitet' value='X__fysisk_aktivitet'>\r\n  <span class='subheading3 X__fysisk_aktivitet'>-fysisk aktivitet</span> <span class='val'>med i grupppgymnastik varje vecka</span></span><!-- closing level 3 section X__fysisk_aktivitet-->\r\n<span class='subsection3 X__alkoholvanor' value='X__alkoholvanor'>\r\n  <span class='subheading3 X__alkoholvanor'>-alkoholvanor</span> <span class='val'>Dricker bara vin vanligen 1 glas till maten</span></span><!-- closing level 3 section X__alkoholvanor-->\r\n</span><!-- closing level 2 section X_Levnadsvanor-->\r\n<span class='subsection2 X_Arftliga_tillstand' value='X_Arftliga_tillstand'>\r\n  <span class='subheading2 X_Arftliga_tillstand'>Ärftliga tillstånd</span> <span class='val'>Ingen diabetes i släkten. Modern behandlad för hypothyreos</span></span><!-- closing level 2 section X_Arftliga_tillstand-->\r\n<span class='subsection2 X_Aktuella_halsoproblem' value='X_Aktuella_halsoproblem'>\r\n  <span class='subheading2 X_Aktuella_halsoproblem'>Aktuella hälsoproblem</span> <span class='val'>Sista 2 mån ej haft några besvär från buken. Mår ganska bra. Sämre syn och skall till optiker näst vecka</span></span><!-- closing level 2 section X_Aktuella_halsoproblem-->\r\n</span><!-- closing level 1 section X_SUBJECTIVE-->\r\n<span class='subsection1 X_OBJECTIVE' value='X_OBJECTIVE'>\r\n  <span class='subheading1 X_OBJECTIVE'>OBJECTIVE</span> \r\n<span class='subsection2 X_Blodtryck__liggande' value='X_Blodtryck__liggande'>\r\n  <span class='subheading2 X_Blodtryck__liggande'>Blodtryck, liggande</span> \r\n<span class='subsection3 X__syst' value='X__syst'>\r\n  <span class='subheading3 X__syst'>-syst</span> <span class='val'>125</span></span><!-- closing level 3 section X__syst-->\r\n<span class='subsection3 X__diast' value='X__diast'>\r\n  <span class='subheading3 X__diast'>-diast</span> <span class='val'>75</span></span><!-- closing level 3 section X__diast-->\r\n</span><!-- closing level 2 section X_Blodtryck__liggande-->\r\n</span><!-- closing level 1 section X_OBJECTIVE-->\r\n<span class='subsection1 X_LAB' value='X_LAB'>\r\n  <span class='subheading1 X_LAB'>LAB</span> \r\n<span class='subsection2 X_Diabetesprover' value='X_Diabetesprover'>\r\n  <span class='subheading2 X_Diabetesprover'>Diabetesprover</span> \r\n<span class='subsection3 X__fP_glukos' value='X__fP_glukos'>\r\n  <span class='subheading3 X__fP_glukos'>-fP-glukos</span> <span class='val'>8.7</span></span><!-- closing level 3 section X__fP_glukos-->\r\n<span class='subsection3 X__P_glukos' value='X__P_glukos'>\r\n  <span class='subheading3 X__P_glukos'>-P-glukos</span> <span class='val'>11.4</span></span><!-- closing level 3 section X__P_glukos-->\r\n<span class='subsection3 X__B_HbA1c__Mono_S_' value='X__B_HbA1c__Mono_S_'>\r\n  <span class='subheading3 X__B_HbA1c__Mono_S_'>-B-HbA1c (Mono-S)</span> <span class='val'>6.8</span></span><!-- closing level 3 section X__B_HbA1c__Mono_S_-->\r\n</span><!-- closing level 2 section X_Diabetesprover-->\r\n<span class='subsection2 X_Urin' value='X_Urin'>\r\n  <span class='subheading2 X_Urin'>Urin</span> \r\n<span class='subsection3 X__U_glukos' value='X__U_glukos'>\r\n  <span class='subheading3 X__U_glukos'>-U-glukos</span> <span class='val'>2+</span></span><!-- closing level 3 section X__U_glukos-->\r\n<span class='subsection3 X__U_protein' value='X__U_protein'>\r\n  <span class='subheading3 X__U_protein'>-U-protein</span> <span class='val'>0</span></span><!-- closing level 3 section X__U_protein-->\r\n<span class='subsection3 X__U_erytrocyter' value='X__U_erytrocyter'>\r\n  <span class='subheading3 X__U_erytrocyter'>-U-erytrocyter</span> <span class='val'>0</span></span><!-- closing level 3 section X__U_erytrocyter-->\r\n</span><!-- closing level 2 section X_Urin-->\r\n<span class='subsection2 X_Blod' value='X_Blod'>\r\n  <span class='subheading2 X_Blod'>Blod</span> \r\n<span class='subsection3 X__Hb' value='X__Hb'>\r\n  <span class='subheading3 X__Hb'>-Hb</span> <span class='val'>124</span></span><!-- closing level 3 section X__Hb-->\r\n</span><!-- closing level 2 section X_Blod-->\r\n<span class='subsection2 X_Njure_elektrolyter' value='X_Njure_elektrolyter'>\r\n  <span class='subheading2 X_Njure_elektrolyter'>Njure-elektrolyter</span> \r\n<span class='subsection3 X__Urat' value='X__Urat'>\r\n  <span class='subheading3 X__Urat'>-Urat</span> <span class='val'>249</span></span><!-- closing level 3 section X__Urat-->\r\n<span class='subsection3 X__Kalium' value='X__Kalium'>\r\n  <span class='subheading3 X__Kalium'>-Kalium</span> <span class='val'>3.9</span></span><!-- closing level 3 section X__Kalium-->\r\n<span class='subsection3 X__Natrium' value='X__Natrium'>\r\n  <span class='subheading3 X__Natrium'>-Natrium</span> <span class='val'>138</span></span><!-- closing level 3 section X__Natrium-->\r\n<span class='subsection3 X__Calcium_korr' value='X__Calcium_korr'>\r\n  <span class='subheading3 X__Calcium_korr'>-Calcium korr</span> <span class='val'>2.23</span></span><!-- closing level 3 section X__Calcium_korr-->\r\n</span><!-- closing level 2 section X_Njure_elektrolyter-->\r\n<span class='subsection2 X_Lever' value='X_Lever'>\r\n  <span class='subheading2 X_Lever'>Lever</span> \r\n<span class='subsection3 X__ALAT' value='X__ALAT'>\r\n  <span class='subheading3 X__ALAT'>-ALAT</span> <span class='val'>0.4</span></span><!-- closing level 3 section X__ALAT-->\r\n</span><!-- closing level 2 section X_Lever-->\r\n</span><!-- closing level 1 section X_LAB-->\r\n<span class='subsection1 X_ASSESSMENT' value='X_ASSESSMENT'>\r\n  <span class='subheading1 X_ASSESSMENT'>ASSESSMENT</span> \r\n<span class='subsection2 X_Bedomt_tillstand' value='X_Bedomt_tillstand'>\r\n  <span class='subheading2 X_Bedomt_tillstand'>Bedömt tillstånd</span> <span class='val'>Litet överraskande har pat en diabetes som verifierats med två förhöjda f-blskr.Torde ha insjuknat nu under våren. Blygsamma symtom där docl hennes refraktionsbesvär kan vara ett delsymtom. Bör ej skaffa nya glasögon vid planerat optiker besök, utan avvakta till dess stabil normoglykemi föreligger.</span></span><!-- closing level 2 section X_Bedomt_tillstand-->\r\n<span class='subsection2 X_Diagnos' value='X_Diagnos'>\r\n  <span class='subheading2 X_Diagnos'>Diagnos</span> \r\n<span class='subsection3 X__text_ICD_10' value='X__text_ICD_10'>\r\n  <span class='subheading3 X__text_ICD_10'>-text ICD 10</span> <span class='val'>Ej insulinberoende diabetes</span></span><!-- closing level 3 section X__text_ICD_10-->\r\n<span class='subsection3 X__kod_ICD_10' value='X__kod_ICD_10'>\r\n  <span class='subheading3 X__kod_ICD_10'>-kod ICD 10</span> <span class='val'>E119</span></span><!-- closing level 3 section X__kod_ICD_10-->\r\n</span><!-- closing level 2 section X_Diagnos-->\r\n</span><!-- closing level 1 section X_ASSESSMENT-->\r\n<span class='subsection1 X_PLAN' value='X_PLAN'>\r\n  <span class='subheading1 X_PLAN'>PLAN</span> \r\n<span class='subsection2 X_Bedomt_aktivitetsbehov' value='X_Bedomt_aktivitetsbehov'>\r\n  <span class='subheading2 X_Bedomt_aktivitetsbehov'>Bedömt aktivitetsbehov</span> <span class='val'>Tid hos diabetessköterska för kostrådgivning och upplärning av blskrtestning</span></span><!-- closing level 2 section X_Bedomt_aktivitetsbehov-->\r\n</span><!-- closing level 1 section X_PLAN-->\r\n<span class='subsection1 X_END' value='X_END'>\r\n  <span class='subheading1 X_END'>END</span> \r\n"
