		"xml__comp_content": "<span class='subsection1 X_SUBJECTIVE' value='X_SUBJECTIVE'>\r\n  <span class='subheading1 X_SUBJECTIVE'>SUBJECTIVE</span> \r\n<span class='subsection3 X__Forlopp' value='X__Forlopp'>\r\n  <span class='subheading3 X__Forlopp'>-Förlopp</span> <span class='val'>Kommer akut då hon i spegeln sett utslag på ryggen på höger sida. Började som stickningar på höger sida av ryggen men nu alltmer värk. Såg i spegeln att det syntes röda märken</span></span><!-- closing level 3 section X__Forlopp-->\r\n</span><!-- closing level 1 section X_SUBJECTIVE-->\r\n<span class='subsection1 X_OBJECTIVE' value='X_OBJECTIVE'>\r\n  <span class='subheading1 X_OBJECTIVE'>OBJECTIVE</span> \r\n<span class='subsection2 X_Allmantillstand' value='X_Allmantillstand'>\r\n  <span class='subheading2 X_Allmantillstand'>Allmäntillstånd</span> <span class='val'>Opåverkad afebril Har på ryggen under höger skulderblad och snett framåt-nedåt grupperade vesikler på rodnad bas. I MCL har flera blåsor brustit</span></span><!-- closing level 2 section X_Allmantillstand-->\r\n</span><!-- closing level 1 section X_OBJECTIVE-->\r\n<span class='subsection1 X_LAB' value='X_LAB'>\r\n  <span class='subheading1 X_LAB'>LAB</span> \r\n</span><!-- closing level 1 section X_LAB-->\r\n<span class='subsection1 X_ASSESSMENT' value='X_ASSESSMENT'>\r\n  <span class='subheading1 X_ASSESSMENT'>ASSESSMENT</span> \r\n<span class='subsection2 X_Bedomt_tillstand' value='X_Bedomt_tillstand'>\r\n  <span class='subheading2 X_Bedomt_tillstand'>Bedömt tillstånd</span> <span class='val'>Kliniken typisk för herpes zooster. </span><span class='subsection3 X__text_ICD_10' value='X__text_ICD_10'>\r\n  <span class='subheading3 X__text_ICD_10'>-text ICD 10</span> <span class='val'>Bältros utan komplikationer</span></span><!-- closing level 3 section X__text_ICD_10-->\r\n<span class='subsection3 X__kod_ICD_10' value='X__kod_ICD_10'>\r\n  <span class='subheading3 X__kod_ICD_10'>-kod ICD 10</span> <span class='val'>B029</span></span><!-- closing level 3 section X__kod_ICD_10-->\r\n</span><!-- closing level 2 section X_Bedomt_tillstand-->\r\n</span><!-- closing level 1 section X_ASSESSMENT-->\r\n<span class='subsection1 X_PLAN' value='X_PLAN'>\r\n  <span class='subheading1 X_PLAN'>PLAN</span> \r\n<span class='subsection2 X_Bedomt_aktivitetsbehov' value='X_Bedomt_aktivitetsbehov'>\r\n  <span class='subheading2 X_Bedomt_aktivitetsbehov'>Bedömt aktivitetsbehov</span> <span class='val'>Tidsgränsen för antiviral behandling har passerat.Får instruktioner om omläggning och analgetika vb. Egen sjukskrivning.</span></span><!-- closing level 2 section X_Bedomt_aktivitetsbehov-->\r\n</span><!-- closing level 1 section X_PLAN-->\r\n<span class='subsection1 X_END' value='X_END'>\r\n  <span class='subheading1 X_END'>END</span> \r\n"
