		"xml__comp_content": "<span class='subsection1 X_SUBJECTIVE' value='X_SUBJECTIVE'>\r\n  <span class='subheading1 X_SUBJECTIVE'>SUBJECTIVE</span> \r\n<span class='subsection2 X_Aktuella_halsoproblem' value='X_Aktuella_halsoproblem'>\r\n  <span class='subheading2 X_Aktuella_halsoproblem'>Aktuella hälsoproblem</span> <span class='val'>Varit barnvakt för sitt yngsta barnbarn för en månad sedan. Fick ngr dagar senare snuva och feber under några dagar. Stel och öm  i kroppen.  Hostan var i början måttlig men har ej gått över. Kan hosta i attacker mest när hon pratar eller går ut. Ingen feber nu. Får på mornar upp slemkladdar annars är det mest torrhosta</span></span><!-- closing level 2 section X_Aktuella_halsoproblem-->\r\n</span><!-- closing level 1 section X_SUBJECTIVE-->\r\n<span class='subsection1 X_OBJECTIVE' value='X_OBJECTIVE'>\r\n  <span class='subheading1 X_OBJECTIVE'>OBJECTIVE</span> \r\n<span class='subsection2 X_Allmantillstand' value='X_Allmantillstand'>\r\n  <span class='subheading2 X_Allmantillstand'>Allmäntillstånd</span> <span class='val'>Opåverkad.Afebril Hostar i perioder under samtalet</span></span><!-- closing level 2 section X_Allmantillstand-->\r\n<span class='subsection2 X_Hjarta_lungor' value='X_Hjarta_lungor'>\r\n  <span class='subheading2 X_Hjarta_lungor'>Hjärta/lungor</span> <span class='val'>Inga ronki eller rassel</span></span><!-- closing level 2 section X_Hjarta_lungor-->\r\n<span class='subsection2 X_PEF' value='X_PEF'>\r\n  <span class='subheading2 X_PEF'>PEF</span> <span class='val'>480</span></span><!-- closing level 2 section X_PEF-->\r\n</span><!-- closing level 1 section X_OBJECTIVE-->\r\n<span class='subsection1 X_LAB' value='X_LAB'>\r\n  <span class='subheading1 X_LAB'>LAB</span> \r\n<span class='subsection2 X_Blod' value='X_Blod'>\r\n  <span class='subheading2 X_Blod'>Blod</span> \r\n<span class='subsection3 X__CRP' value='X__CRP'>\r\n  <span class='subheading3 X__CRP'>-CRP</span> <span class='val'>< 10</span></span><!-- closing level 3 section X__CRP-->\r\n</span><!-- closing level 2 section X_Blod-->\r\n</span><!-- closing level 1 section X_LAB-->\r\n<span class='subsection1 X_ASSESSMENT' value='X_ASSESSMENT'>\r\n  <span class='subheading1 X_ASSESSMENT'>ASSESSMENT</span> \r\n<span class='subsection2 X_Bedomt_tillstand' value='X_Bedomt_tillstand'>\r\n  <span class='subheading2 X_Bedomt_tillstand'>Bedömt tillstånd</span> <span class='val'>Kvarstående hosta efter viros. </span><span class='subsection3 X__text_ICD_10' value='X__text_ICD_10'>\r\n  <span class='subheading3 X__text_ICD_10'>-text ICD 10</span> <span class='val'>Hosta</span></span><!-- closing level 3 section X__text_ICD_10-->\r\n<span class='subsection3 X__kod_ICD_10' value='X__kod_ICD_10'>\r\n  <span class='subheading3 X__kod_ICD_10'>-kod ICD 10</span> <span class='val'>R509</span></span><!-- closing level 3 section X__kod_ICD_10-->\r\n</span><!-- closing level 2 section X_Bedomt_tillstand-->\r\n</span><!-- closing level 1 section X_ASSESSMENT-->\r\n<span class='subsection1 X_PLAN' value='X_PLAN'>\r\n  <span class='subheading1 X_PLAN'>PLAN</span> \r\n<span class='subsection3 X__ovriga_lakemedel' value='X__ovriga_lakemedel'>\r\n  <span class='subheading3 X__ovriga_lakemedel'>-övriga läkemedel</span> <span class='val'>R05CB10 Mollipect 15 ml x 2-3</span></span><!-- closing level 3 section X__ovriga_lakemedel-->\r\n<span class='subsection2 X_Bedomt_aktivitetsbehov' value='X_Bedomt_aktivitetsbehov'>\r\n  <span class='subheading2 X_Bedomt_aktivitetsbehov'>Bedömt aktivitetsbehov</span> <span class='val'>Ej så obstruktiv att det motiverar behandling. Får Mollipect</span></span><!-- closing level 2 section X_Bedomt_aktivitetsbehov-->\r\n</span><!-- closing level 1 section X_PLAN-->\r\n<span class='subsection1 X_END' value='X_END'>\r\n  <span class='subheading1 X_END'>END</span> \r\n"
