		"xml__comp_content": "<span class='subsection1 X_SUBJECTIVE' value='X_SUBJECTIVE'>\r\n  <span class='subheading1 X_SUBJECTIVE'>SUBJECTIVE</span> \r\n<span class='subsection2 X_Aktuella_halsoproblem' value='X_Aktuella_halsoproblem'>\r\n  <span class='subheading2 X_Aktuella_halsoproblem'>Aktuella hälsoproblem</span> <span class='val'>Patient änkeman sedan årsskiftet. Haft en svår tid att hitta en balans i livet. Sökt kontakt med några tidigare arbetskamrater varav en i samma livssituation. Varit på golfresa i Spanien. Fick efter några dagar en magsjuka med ihållande diarre och kräkningar. Möjligen lätt feber initialt. Mestadels vistats på hotellrummet. Svårt att äta och har gått ned rejält i vikt. Uppskattar det själv till 8-9 kg. Har inga diarrer nu men känner sig svag och trött</span></span><!-- closing level 2 section X_Aktuella_halsoproblem-->\r\n<span class='subsection2 X_Diabetes' value='X_Diabetes'>\r\n  <span class='subheading2 X_Diabetes'>Diabetes</span> \r\n<span class='subsection3 X__Forlopp' value='X__Forlopp'>\r\n  <span class='subheading3 X__Forlopp'>-Förlopp</span> <span class='val'>Hade ej med blskrstickor på resa. Ej tänkt på att sockret kan ha påverkats av infektionen</span></span><!-- closing level 3 section X__Forlopp-->\r\n</span><!-- closing level 2 section X_Diabetes-->\r\n</span><!-- closing level 1 section X_SUBJECTIVE-->\r\n<span class='subsection1 X_OBJECTIVE' value='X_OBJECTIVE'>\r\n  <span class='subheading1 X_OBJECTIVE'>OBJECTIVE</span> \r\n<span class='subsection2 X_Allmantillstand' value='X_Allmantillstand'>\r\n  <span class='subheading2 X_Allmantillstand'>Allmäntillstånd</span> <span class='val'>Påtaglig viktsnedgång. Helt orienterad och adekvat</span><span class='subsection3 X__vikt' value='X__vikt'>\r\n  <span class='subheading3 X__vikt'>-vikt</span> <span class='val'>107</span></span><!-- closing level 3 section X__vikt-->\r\n</span><!-- closing level 2 section X_Allmantillstand-->\r\n<span class='subsection2 X_Hjarta_lungor' value='X_Hjarta_lungor'>\r\n  <span class='subheading2 X_Hjarta_lungor'>Hjärta/lungor</span> <span class='val'>Rtg rytm Diastoliskt bljd grad 2</span></span><!-- closing level 2 section X_Hjarta_lungor-->\r\n<span class='subsection2 X_Buk' value='X_Buk'>\r\n  <span class='subheading2 X_Buk'>Buk</span> <span class='val'>Mjuk och oöm Ingen hepatomegali</span></span><!-- closing level 2 section X_Buk-->\r\n<span class='subsection2 X_Blodtryck__liggande' value='X_Blodtryck__liggande'>\r\n  <span class='subheading2 X_Blodtryck__liggande'>Blodtryck, liggande</span> \r\n<span class='subsection3 X__syst' value='X__syst'>\r\n  <span class='subheading3 X__syst'>-syst</span> <span class='val'>130</span></span><!-- closing level 3 section X__syst-->\r\n<span class='subsection3 X__diast' value='X__diast'>\r\n  <span class='subheading3 X__diast'>-diast</span> <span class='val'>75</span></span><!-- closing level 3 section X__diast-->\r\n</span><!-- closing level 2 section X_Blodtryck__liggande-->\r\n</span><!-- closing level 1 section X_OBJECTIVE-->\r\n<span class='subsection1 X_LAB' value='X_LAB'>\r\n  <span class='subheading1 X_LAB'>LAB</span> \r\n<span class='subsection2 X_Diabetesprover' value='X_Diabetesprover'>\r\n  <span class='subheading2 X_Diabetesprover'>Diabetesprover</span> \r\n<span class='subsection3 X__P_glukos' value='X__P_glukos'>\r\n  <span class='subheading3 X__P_glukos'>-P-glukos</span> <span class='val'>22</span></span><!-- closing level 3 section X__P_glukos-->\r\n</span><!-- closing level 2 section X_Diabetesprover-->\r\n<span class='subsection2 X_Njure_elektrolyter' value='X_Njure_elektrolyter'>\r\n  <span class='subheading2 X_Njure_elektrolyter'>Njure-elektrolyter</span> \r\n<span class='subsection3 X__Kalium' value='X__Kalium'>\r\n  <span class='subheading3 X__Kalium'>-Kalium</span> <span class='val'>3.9</span></span><!-- closing level 3 section X__Kalium-->\r\n<span class='subsection3 X__Natrium' value='X__Natrium'>\r\n  <span class='subheading3 X__Natrium'>-Natrium</span> <span class='val'>145</span></span><!-- closing level 3 section X__Natrium-->\r\n<span class='subsection3 X__Calcium_korr' value='X__Calcium_korr'>\r\n  <span class='subheading3 X__Calcium_korr'>-Calcium korr</span> <span class='val'>2.55</span></span><!-- closing level 3 section X__Calcium_korr-->\r\n</span><!-- closing level 2 section X_Njure_elektrolyter-->\r\n<span class='subsection2 X_Lever' value='X_Lever'>\r\n  <span class='subheading2 X_Lever'>Lever</span> \r\n<span class='subsection3 X__ALAT' value='X__ALAT'>\r\n  <span class='subheading3 X__ALAT'>-ALAT</span> <span class='val'>1.9</span></span><!-- closing level 3 section X__ALAT-->\r\n</span><!-- closing level 2 section X_Lever-->\r\n</span><!-- closing level 1 section X_LAB-->\r\n<span class='subsection1 X_ASSESSMENT' value='X_ASSESSMENT'>\r\n  <span class='subheading1 X_ASSESSMENT'>ASSESSMENT</span> \r\n<span class='subsection2 X_Bedomt_tillstand' value='X_Bedomt_tillstand'>\r\n  <span class='subheading2 X_Bedomt_tillstand'>Bedömt tillstånd</span> <span class='val'>Kraftigt försämrad  glukoskontroll i anslutning till gastroenterit. Ligger högt i blskr men inge ketos. Är såpass opåverkad att vi har möjligheter till poliklinisk insulininställning genom tät daglig kontakt. Hans perorala diabetes behandling avslutas.</span></span><!-- closing level 2 section X_Bedomt_tillstand-->\r\n<span class='subsection2 X_Diagnos' value='X_Diagnos'>\r\n  <span class='subheading2 X_Diagnos'>Diagnos</span> \r\n<span class='subsection3 X__text_ICD_10' value='X__text_ICD_10'>\r\n  <span class='subheading3 X__text_ICD_10'>-text ICD 10</span> <span class='val'>Insulinberoende diabetes med ögonkomplikation E103</span></span><!-- closing level 3 section X__text_ICD_10-->\r\n<span class='subsection3 X__kod_ICD_10' value='X__kod_ICD_10'>\r\n  <span class='subheading3 X__kod_ICD_10'>-kod ICD 10</span> <span class='val'>E109</span></span><!-- closing level 3 section X__kod_ICD_10-->\r\n</span><!-- closing level 2 section X_Diagnos-->\r\n</span><!-- closing level 1 section X_ASSESSMENT-->\r\n<span class='subsection1 X_PLAN' value='X_PLAN'>\r\n  <span class='subheading1 X_PLAN'>PLAN</span> \r\n<span class='subsection2 X_Lakemedel' value='X_Lakemedel'>\r\n  <span class='subheading2 X_Lakemedel'>Läkemedel</span> \r\n<span class='subsection3 X__p_o_antidiabetika_' value='X__p_o_antidiabetika_'>\r\n  <span class='subheading3 X__p_o_antidiabetika_'>-p o antidiabetika </span> <span class='val'>0</span></span><!-- closing level 3 section X__p_o_antidiabetika_-->\r\n<span class='subsection3 X__insulin_lunch' value='X__insulin_lunch'>\r\n  <span class='subheading3 X__insulin_lunch'>-insulin lunch</span> <span class='val'>Novomix 30 Flexpen A10AD05 40 E</span></span><!-- closing level 3 section X__insulin_lunch-->\r\n</span><!-- closing level 2 section X_Lakemedel-->\r\n<span class='subsection2 X_Bedomt_aktivitetsbehov' value='X_Bedomt_aktivitetsbehov'>\r\n  <span class='subheading2 X_Bedomt_aktivitetsbehov'>Bedömt aktivitetsbehov</span> <span class='val'>Börjar lära sig injektionsteknik idag. Får nu 40 E Novomix till kvällen. Tar själv blskr och återkommer imorgon bitti</span></span><!-- closing level 2 section X_Bedomt_aktivitetsbehov-->\r\n</span><!-- closing level 1 section X_PLAN-->\r\n<span class='subsection1 X_END' value='X_END'>\r\n  <span class='subheading1 X_END'>END</span> \r\n"
