		"xml__comp_content": "<span class='subsection1 X_SUBJECTIVE' value='X_SUBJECTIVE'>\r\n  <span class='subheading1 X_SUBJECTIVE'>SUBJECTIVE</span> \r\n<span class='subsection2 X_Blodsockerprofil' value='X_Blodsockerprofil'>\r\n  <span class='subheading2 X_Blodsockerprofil'>Blodsockerprofil</span> \r\n<span class='subsection3 X__fore_frukost' value='X__fore_frukost'>\r\n  <span class='subheading3 X__fore_frukost'>-före frukost</span> <span class='val'>19</span></span><!-- closing level 3 section X__fore_frukost-->\r\n<span class='subsection3 X__fore_lunch' value='X__fore_lunch'>\r\n  <span class='subheading3 X__fore_lunch'>-före lunch</span> <span class='val'>16.4</span></span><!-- closing level 3 section X__fore_lunch-->\r\n<span class='subsection3 X__fore_middag' value='X__fore_middag'>\r\n  <span class='subheading3 X__fore_middag'>-före middag</span> <span class='val'>17.6</span></span><!-- closing level 3 section X__fore_middag-->\r\n<span class='subsection3 X__efter_middag' value='X__efter_middag'>\r\n  <span class='subheading3 X__efter_middag'>-efter middag</span> <span class='val'>18.4</span></span><!-- closing level 3 section X__efter_middag-->\r\n</span><!-- closing level 2 section X_Blodsockerprofil-->\r\n<span class='subsection2 X_Symtomrapportering' value='X_Symtomrapportering'>\r\n  <span class='subheading2 X_Symtomrapportering'>Symtomrapportering</span> \r\n<span class='subsection3 X__svara_hypoglykemier' value='X__svara_hypoglykemier'>\r\n  <span class='subheading3 X__svara_hypoglykemier'>-svåra hypoglykemier</span> <span class='val'>Nej</span></span><!-- closing level 3 section X__svara_hypoglykemier-->\r\n</span><!-- closing level 2 section X_Symtomrapportering-->\r\n<span class='subsection2 X_Aktuella_halsoproblem' value='X_Aktuella_halsoproblem'>\r\n  <span class='subheading2 X_Aktuella_halsoproblem'>Aktuella hälsoproblem</span> <span class='val'>Har knip i magen men inga diarrer. Fått hjälp av barn att handla mm</span></span><!-- closing level 2 section X_Aktuella_halsoproblem-->\r\n<span class='subsection2 X_Diabetes' value='X_Diabetes'>\r\n  <span class='subheading2 X_Diabetes'>Diabetes</span> \r\n<span class='subsection3 X__Forlopp' value='X__Forlopp'>\r\n  <span class='subheading3 X__Forlopp'>-Förlopp</span> <span class='val'>Inga känningar under natten.Svårt att se med sina glasögon.</span></span><!-- closing level 3 section X__Forlopp-->\r\n</span><!-- closing level 2 section X_Diabetes-->\r\n</span><!-- closing level 1 section X_SUBJECTIVE-->\r\n<span class='subsection1 X_OBJECTIVE' value='X_OBJECTIVE'>\r\n  <span class='subheading1 X_OBJECTIVE'>OBJECTIVE</span> \r\n<span class='subsection2 X_Allmantillstand' value='X_Allmantillstand'>\r\n  <span class='subheading2 X_Allmantillstand'>Allmäntillstånd</span> <span class='val'>Orolig. helt orienterad</span><span class='subsection3 X__vikt' value='X__vikt'>\r\n  <span class='subheading3 X__vikt'>-vikt</span> <span class='val'>108</span></span><!-- closing level 3 section X__vikt-->\r\n</span><!-- closing level 2 section X_Allmantillstand-->\r\n<span class='subsection2 X_Blodtryck__liggande' value='X_Blodtryck__liggande'>\r\n  <span class='subheading2 X_Blodtryck__liggande'>Blodtryck, liggande</span> \r\n<span class='subsection3 X__syst' value='X__syst'>\r\n  <span class='subheading3 X__syst'>-syst</span> <span class='val'>135</span></span><!-- closing level 3 section X__syst-->\r\n<span class='subsection3 X__diast' value='X__diast'>\r\n  <span class='subheading3 X__diast'>-diast</span> <span class='val'>85</span></span><!-- closing level 3 section X__diast-->\r\n</span><!-- closing level 2 section X_Blodtryck__liggande-->\r\n</span><!-- closing level 1 section X_OBJECTIVE-->\r\n<span class='subsection1 X_LAB' value='X_LAB'>\r\n  <span class='subheading1 X_LAB'>LAB</span> \r\n</span><!-- closing level 1 section X_LAB-->\r\n<span class='subsection1 X_ASSESSMENT' value='X_ASSESSMENT'>\r\n  <span class='subheading1 X_ASSESSMENT'>ASSESSMENT</span> \r\n<span class='subsection2 X_Bedomt_tillstand' value='X_Bedomt_tillstand'>\r\n  <span class='subheading2 X_Bedomt_tillstand'>Bedömt tillstånd</span> <span class='val'>Som förväntat föreligger här en betydande insulinresistens. Tar prover före varje dostillfälle och får ett insulindosschema att följa. Blskr< 6    32        22  26           Blskr 6-10      40        24    30                    Blskr >10     44     26     38  Åter imorgon                                 </span></span><!-- closing level 2 section X_Bedomt_tillstand-->\r\n</span><!-- closing level 1 section X_ASSESSMENT-->\r\n<span class='subsection1 X_PLAN' value='X_PLAN'>\r\n  <span class='subheading1 X_PLAN'>PLAN</span> \r\n<span class='subsection2 X_Lakemedel' value='X_Lakemedel'>\r\n  <span class='subheading2 X_Lakemedel'>Läkemedel</span> \r\n<span class='subsection3 X__insulin_morg' value='X__insulin_morg'>\r\n  <span class='subheading3 X__insulin_morg'>-insulin morg</span> <span class='val'>Novomix 30 Flexpen A10AD05 46 E</span></span><!-- closing level 3 section X__insulin_morg-->\r\n<span class='subsection3 X__insulin_lunch' value='X__insulin_lunch'>\r\n  <span class='subheading3 X__insulin_lunch'>-insulin lunch</span> <span class='val'>Novomix 30 Flexpen A10AD05 26E</span></span><!-- closing level 3 section X__insulin_lunch-->\r\n<span class='subsection3 X__insulin_middag' value='X__insulin_middag'>\r\n  <span class='subheading3 X__insulin_middag'>-insulin middag</span> <span class='val'>Novomix 30 Flexpen A10AD05 36 E</span></span><!-- closing level 3 section X__insulin_middag-->\r\n</span><!-- closing level 2 section X_Lakemedel-->\r\n<span class='subsection2 X_Bedomt_aktivitetsbehov' value='X_Bedomt_aktivitetsbehov'>\r\n  <span class='subheading2 X_Bedomt_aktivitetsbehov'>Bedömt aktivitetsbehov</span> <span class='val'>Tränar ytterligare injektionsteknik. Har svårt att sticka lugnt utan är litet våldsam i sitt rörelemönster. Repeterar hur hans  kombinationsinsulin fungerar liksom effekter av måltid och fysisk aktivitet</span></span><!-- closing level 2 section X_Bedomt_aktivitetsbehov-->\r\n</span><!-- closing level 1 section X_PLAN-->\r\n<span class='subsection1 X_END' value='X_END'>\r\n  <span class='subheading1 X_END'>END</span> \r\n"
